import styles from "../component/card.css"

function Card(props) {
    let className;
    {(props.boolean=='true')
    ? className = 'regular'
    : className = ''
    }
       return (



       <div class="row" className={className}>
        <div></div>
           <div class ="cell">{props.english}</div><div class ="cell"> {props.transcription}</div> <div class ="cell"> {props.russian}</div><div class ="cell">{props.tags}</div>
       </div>
  
   
    
    );
}
export default Card
